import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  componentDidMount() {
    fetch('https://api.fitbit.com/1/user/72CVS3/profile.json', {
      headers: 'Authorization: Bearer eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiIyMkRGQ0wiLCJzdWIiOiI3MkNWUzMiLCJpc3MiOiJGaXRiaXQiLCJ0eXAiOiJhY2Nlc3NfdG9rZW4iLCJzY29wZXMiOiJyc29jIHJhY3QgcnNldCBybG9jIHJ3ZWkgcmhyIHJwcm8gcm51dCByc2xlIiwiZXhwIjoxNTQ1MjMzMjY5LCJpYXQiOjE1NDQ2NDM2MzJ9.a8TDnT5PPBwDe7OsM5HmCkzdxDxp74tIscGcRMULIRs'
    })
      .then(res => res.json())
      .then(console.log)
      .then(console.log('Made it here'))
  }

  render() {
    return (
      <div className="App">
        sleepTracker
      </div>
    );
  }
}

export default App;
